import React, { Component } from "react";
import { isEmpty } from "lodash";

class Helpers extends Component {
  constructor(props) {
    super(props);
    this.state = {
      memberList: null
    };
  }

  updateMemberList(list) {
    this.setState({
      memberList: list
    });
  }

  getMembersList() {
    return this.state.memberList;
  }
}

export default Helpers;
